import React, { Component } from 'react';

class Photos extends Component {
  render() {
    return (
      <div className="maintext">
          <h1 style={{paddingTop:'30px'}}>
	    Some Photos of me
          </h1>
	  <img src='../../static/huazhou_pic.JPG' alt='failed'></img>
      </div>
    );
  }
}

export default Photos;
